import React from 'react';

const GrampsSection = () => {
  return (
    <section id="gramps" className="py-12 bg-gray-100">
      <div className="container mx-auto px-4 text-center">
        <h2 className="text-3xl font-bold uppercase text-yellow-500 mb-4">What does GRAMPS mean?</h2>
        <div className="flex justify-center items-center mb-8">
          {/* Logo */}
          <div className="mr-4">
            <img src="your-logo.png" alt="Your Logo" className="h-12" />
          </div>
          {/* Acronym */}
          <div className="text-5xl font-bold">
            <span className="text-yellow-500">G</span>
            <span className="text-green-500">R</span>
            <span className="text-blue-500">A</span>
            <span className="text-purple-500">M</span>
            <span className="text-pink-500">P</span>
            <span className="text-yellow-500">S</span>
          </div>
        </div>
        <p className="text-lg text-gray-800 mb-8">
          Geriatric Resources, Advising, Moving, & Placement Services of Tennessee (GRAMPS) provides comprehensive services for seniors and their families.
        </p>
        {/* Add more content as needed */}
      </div>
    </section>
  );
}

export default GrampsSection;
